import React from 'react';
import { View, Text, StyleSheet } from 'react-native';
 
const HomeScreen = ({ navigation }) => {
    return (
      <View>
        <Text>Public Landing Screen</Text>
        <Button
          title="Go to Home"
          onPress={() => navigation.navigate('Home')}
        />
      </View>
    );
  };

export default HomeScreen;
